    {
      title: "Leadership & Volunteering",
      experiences: [
        {
          name: "IRS-certified Volunteer",
          time: "Feb 2021 – Jun 2021",
          bullets: [
            "VITA (Volunteer Income Tax Assistance) Program by Dallas Tax Centers",
            "Put in 20 hours in total and helped people in the community get a sum of nearly $9,000 in refund"
          ]
        },
        {
          name: "Vice President for Social Media, Mu Alpha Theta",
          time: "Mar 2020 – May 2021",
          bullets: [
            "Organized Math4Fun activities on campus.",
            "Invited famous alumni/professors to deliver lectures and provided a communication platform for students interested in mathematics."
          ]
        }
      ]
    }
  ];

  export default othersData;
